import React from 'react'

function Homelogo(props) {
    return (
        <div className="homepage" >
            
               {props.icon}
               <div style={{width:'40px',height:'20px',backgroundColor:'black'}}>
               <h4>{props.tittle}</h4>
            </div>
        </div>
    )
}

export default Homelogo
